            const labels = [];
            const data = [];
            for (let x of object) {
                var formattedDate = x.date.substring(0, 10);
                labels.push(formattedDate);
                data.push({ t: moment(x.date, 'L').toDate(), y: x.count });
            }

            const transactionChart = new Chart(canvas, {
