                        },
                        backgroundColor: ""rgba(255, 99, 132, 0.2)"",
                        borderColor: ""rgba(255, 99, 132, 1)"",
                        borderWidth: 1
                    }]
                }
            });
        });
        document.getElementById(""button"").style = ""display:block"";
    })
</script>
